// SPDX-License-Identifier: MIT
pragma solidity >=0.6.12;
pragma experimental ABIEncoderV2;

import "../openzeppelin/contracts/math/SafeMath.sol";
import "../openzeppelin/contracts/access/Ownable.sol";
import "../openzeppelin/contracts/utils/Strings.sol";
import "../quote/QuoteFactory.sol";
import "../interface/ISwapTrade.sol";
import "../interface/ITeemoPool.sol";
import "../libraries/SwapTradeLibrary.sol";

contract SwapTrade is Ownable, ISwapTrade {
    using SafeMath for uint256;

    struct SwapLimitOrder {
        address userAddr;
        string symbol;
        uint256 tokenAmount;
        uint256 lever;
        uint256 bsFlag;// 建仓方向 1空 2多
        uint256 openPrice;// 市价建仓价或者委托建仓价
        uint256 openTime;// 委托时间
        uint256 newPrice;// 委托建仓时最新价
        uint256 pLimitPrice;// 止盈价
        uint256 lLimitPrice;// 止损价
        uint256 closeTime;// 成交时间
        uint256 status;// 订单状态 1:已撤单 2未成交 3已成交
    }
    struct SwapOrder {
        address userAddr;
        string symbol;
        uint256 tokenAmount;
        uint256 lever;
        uint256 bsFlag;// 建仓方向 1空 2多
        uint256 openPrice;// 建仓价
        uint256 openTime;// 建仓时间
        uint256 pLimitPrice;// 止盈价
        uint256 lLimitPrice;// 止损价
        uint256 closePrice;// 平仓价
        uint256 closeTime;// 平仓时间
    }
    address public tokenAddr;
    address public poolAddr;
    address public quoteFactoryAddr;

    mapping(bytes32 => SwapOrder) public allOrderHash;// 订单号=>订单信息
    mapping(address => bytes32[]) public allOrderUser;// 用户地址=>订单号数组

    mapping(bytes32 => SwapLimitOrder) public allLimitOrderHash;// 订单号=>订单信息
    mapping(address => bytes32[]) public allLimitOrderUser;// 用户地址=>订单号数组

    function initialize(address _tokenAddr, address _poolAddr) public onlyOwner{
        tokenAddr = _tokenAddr;
        poolAddr = _poolAddr;
        quoteFactoryAddr = ITeemoPool(poolAddr).getQuoteFactoryAddr();
    } 

    function orderLength(address _userAddress) public view returns(uint256) {
        return allOrderUser[_userAddress].length;
    }

    function limitOrderLength(address _userAddress) public view returns(uint256) {
        return allLimitOrderUser[_userAddress].length;
    }

    //0所有 1已平仓 2未平仓
    function getAllOrder(address _userAddress, uint8 status) public view returns(
        bytes32[] memory orderIds,
        SwapOrder[] memory orders
        ) {
        orderIds = allOrderUser[_userAddress];
        uint256 size = 0;
        for (uint i = 0; i < orderIds.length; i++) {
            SwapOrder memory order = allOrderHash[orderIds[i]];
            if (status == 0 || (status == 1 && order.closePrice > 0) || (status == 2 && order.closePrice == 0)) {
                size++;
            }
        }
        orders = new SwapOrder[](size);
        uint256 index = 0;
        for (uint i = 0; i < orderIds.length; i++) {
            SwapOrder memory order = allOrderHash[orderIds[i]];
            if (status == 0 || (status == 1 && order.closePrice > 0) || (status == 2 && order.closePrice == 0)) {
                orderIds[index] = orderIds[i];
                orders[index] = order;
                index++;
            }
        }
    }

    //0所有 1:已撤单 2未成交 3已成交 4已撤单-已成交
    function getAllLimitOrder(address _userAddress, uint8 status) public view returns(
        bytes32[] memory orderIds,
        SwapLimitOrder[] memory orders
        ) {
        orderIds = allLimitOrderUser[_userAddress];
        uint256 size = 0;
        for (uint i = 0; i < orderIds.length; i++) {
            SwapLimitOrder memory order = allLimitOrderHash[orderIds[i]];
            if (status == 0 || status == order.status || (status == 4 && (order.status == 1 || order.status == 3))) {
                size++;
            }
        }
        orders = new SwapLimitOrder[](size);
        uint256 index = 0;
        for (uint i = 0; i < orderIds.length; i++) {
            SwapLimitOrder memory order = allLimitOrderHash[orderIds[i]];
            if (status == 0 || status == order.status || (status == 4 && (order.status == 1 || order.status == 3))) {
                orderIds[index] = orderIds[i];
                orders[index] = order;
                index++;
            }
        }
    }

    // 永续合约创建限价单
    function openLimitSwap(address _userAddr,string memory _symbol,uint256 _limitPrice,uint256 _tokenAmount,uint256 _lever,uint256 _bsFlag,uint256 _pLimitPrice,uint256 _lLimitPrice) 
        public override onlyOwner 
        returns (bytes32, uint256) {
        uint256[2] memory priceInfo;
        (priceInfo[0],priceInfo[1]) = getNewPrice(_symbol);
        bytes32 orderID = keccak256(abi.encode(block.number,gasleft(),_userAddr,_symbol,_tokenAmount,_lever,_bsFlag));
        allLimitOrderHash[orderID] = SwapLimitOrder({
            userAddr: _userAddr,
            symbol: _symbol,
            tokenAmount: _tokenAmount,
            lever: _lever,
            bsFlag: _bsFlag,
            openPrice: _limitPrice,
            openTime: priceInfo[1],
            newPrice: priceInfo[0],
            pLimitPrice: _pLimitPrice,
            lLimitPrice: _lLimitPrice,
            closeTime: 0,
            status: 2
        });
        allLimitOrderUser[_userAddr].push(orderID);
        return (orderID,priceInfo[0]);
    }
    // 永续合约取消限价单
    function cancelLimitSwap(address _userAddr,bytes32 _orderID) 
        public override onlyOwner
        returns (uint256 tokenAmount)
    {
        SwapLimitOrder storage orderInfo = allLimitOrderHash[_orderID];
        require(orderInfo.userAddr == _userAddr, "cancelLimitSwap: USERADDR_WRONG");
        require(orderInfo.status == 2, "cancelLimitSwap: ORDER_STATUS_WRONG");
        tokenAmount = orderInfo.tokenAmount;
        orderInfo.closeTime = block.timestamp;
        orderInfo.status = 1;
    }
    // 永续合约成交限价单
    function tradeLimitSwap(bytes32 _orderID,uint256 _blockIndex) 
        public override onlyOwner
        returns (bool success,address userAddr,uint256 tokenAmount)
    {
        SwapLimitOrder storage orderInfo = allLimitOrderHash[_orderID];
        require(orderInfo.status == 2, "tradeLimitSwap: ORDER_STATUS_WRONG");
        (uint256 tradePrice,uint256 priceTime) = getLastPrice(orderInfo.symbol,_blockIndex);
        require(orderInfo.openTime < priceTime, "tradeLimitSwap: ORDER_TIME_WRONG");
        success = SwapTradeLibrary.isTradeLimitSwap(orderInfo.newPrice,orderInfo.openPrice,tradePrice);
        if(success == true){
            tokenAmount = orderInfo.tokenAmount;
            userAddr = orderInfo.userAddr;
            orderInfo.closeTime = priceTime;
            orderInfo.status = 3;
            allOrderHash[_orderID] = SwapOrder({
                userAddr: orderInfo.userAddr,
                symbol: orderInfo.symbol,
                tokenAmount: orderInfo.tokenAmount,
                lever: orderInfo.lever,
                bsFlag: orderInfo.bsFlag,
                openPrice: orderInfo.openPrice,
                openTime: orderInfo.closeTime,
                pLimitPrice: orderInfo.pLimitPrice,
                lLimitPrice: orderInfo.lLimitPrice,
                closePrice: 0,
                closeTime: 0
            });
            allOrderUser[orderInfo.userAddr].push(_orderID);            
        }
    }    

    // 永续合约市价建仓
    function openMarketSwap(address _userAddr,string memory _symbol,uint256 _tokenAmount,uint256 _lever,uint256 _bsFlag,uint256 _pLimitPrice,uint256 _lLimitPrice, uint256 _maxPrice) 
        public override onlyOwner returns (bytes32, uint256) {
        uint256[2] memory priceInfo;
        (priceInfo[0],priceInfo[1]) = getNewPrice(_symbol);
        if(_bsFlag == 1){
            require(priceInfo[0]>=_maxPrice, 'openMarketSwap: SLIPPAGE_TOO_HIGH');
        }else{
            require(priceInfo[0]<=_maxPrice, 'openMarketSwap: SLIPPAGE_TOO_HIGH');
        }
        bytes32 orderID = keccak256(abi.encode(block.number,gasleft(),_userAddr,_symbol,_tokenAmount,_lever,_bsFlag));
        allOrderHash[orderID] = SwapOrder({
            userAddr: _userAddr,
            symbol: _symbol,
            tokenAmount: _tokenAmount,
            lever: _lever,
            bsFlag: _bsFlag,
            openPrice: priceInfo[0],
            openTime: priceInfo[1],
            pLimitPrice: _pLimitPrice,
            lLimitPrice: _lLimitPrice,
            closePrice: 0,
            closeTime: 0
        });
        allOrderUser[_userAddr].push(orderID);
        return (orderID,priceInfo[0]);
    }

    // 永续合约市价平仓
    function closeMarketSwap(address _userAddr,bytes32 _orderID) 
        public override onlyOwner
        returns (uint256 closePrice,uint256 plFlag,uint256 plAmount,uint256 tokenAmount)
    {
        SwapOrder storage orderInfo = allOrderHash[_orderID];
        require(orderInfo.userAddr == _userAddr, "closeSwap: USERADDR_WRONG");
        require(orderInfo.closePrice == 0, "closeSwap: ORDER_STATUS_WRONG");
        uint256 priceTime = 0;
        (closePrice,priceTime) = getNewPrice(orderInfo.symbol);
        tokenAmount = orderInfo.tokenAmount;
        (plFlag, plAmount) = SwapTradeLibrary.calcSwapOrderPL(orderInfo.bsFlag,orderInfo.tokenAmount,orderInfo.lever,orderInfo.openPrice,closePrice);
        orderInfo.closePrice = closePrice;
        orderInfo.closeTime = priceTime;
    }

    // 永续合约限价平仓
    function closeLimitSwap(bytes32 _orderID,uint256 _blockIndex) 
        public override onlyOwner
        returns (bool success,address userAddr,uint256 closePrice,uint256 closeType,uint256 plFlag,uint256 plAmount,uint256 tokenAmount)
    {
        SwapOrder storage orderInfo = allOrderHash[_orderID];
        require(orderInfo.closePrice == 0, "closeSwap: ORDER_STATUS_WRONG");
        (uint256 lastPrice,uint256 priceTime) = getLastPrice(orderInfo.symbol,_blockIndex);
        require(orderInfo.openTime < priceTime, "tradeLimitSwap: ORDER_TIME_WRONG");
        (success,closePrice,closeType) = SwapTradeLibrary.calcSwapOrderCloseInfo(orderInfo.bsFlag,orderInfo.openPrice,orderInfo.lever,orderInfo.tokenAmount,orderInfo.pLimitPrice,orderInfo.lLimitPrice,lastPrice);
        if(success == true){
            tokenAmount = orderInfo.tokenAmount;
            userAddr = orderInfo.userAddr;
            (plFlag, plAmount) = SwapTradeLibrary.calcSwapOrderPL(orderInfo.bsFlag,orderInfo.tokenAmount,orderInfo.lever,orderInfo.openPrice,closePrice);
            orderInfo.closePrice = closePrice;
            orderInfo.closeTime = priceTime;
        }
    }    
    // 永续合约更新止盈止损价
    function updateSwapByPrice(address _userAddr,bytes32 _orderID,uint256 _pLimitPrice,uint256 _lLimitPrice) 
        public override onlyOwner 
        returns (uint256 pLimitRate,uint256 lLimitRate) {
        SwapOrder storage orderInfo = allOrderHash[_orderID];
        require(orderInfo.userAddr == _userAddr, "closeSwap: USERADDR_WRONG");
        require(orderInfo.closePrice == 0, "closeSwap: ORDER_STATUS_WRONG");
        if(orderInfo.bsFlag == 1){
            require(_pLimitPrice > 0 && _pLimitPrice < orderInfo.openPrice, "closeSwap: ORDER_PLIMITPRICE_WRONG"); 
            require(_lLimitPrice > 0 && _lLimitPrice > orderInfo.openPrice, "closeSwap: ORDER_LLIMITPRICE_WRONG");
        }else{
            require(_pLimitPrice > 0 && _pLimitPrice > orderInfo.openPrice, "closeSwap: ORDER_PLIMITPRICE_WRONG"); 
            require(_lLimitPrice > 0 && _lLimitPrice < orderInfo.openPrice, "closeSwap: ORDER_LLIMITPRICE_WRONG"); 
        }
        pLimitRate = SwapTradeLibrary.calcSwapOrderPRate(orderInfo.bsFlag,orderInfo.openPrice,_pLimitPrice);
        lLimitRate = SwapTradeLibrary.calcSwapOrderPRate(orderInfo.bsFlag,orderInfo.openPrice,_lLimitPrice);
        orderInfo.pLimitPrice = _pLimitPrice;
        orderInfo.lLimitPrice = _lLimitPrice;
    }

    // 永续合约更新止盈止损价
    function updateSwapByRate(address _userAddr,bytes32 _orderID,uint256 _pLimitRate,uint256 _lLimitRate) 
        public override onlyOwner 
        returns (uint256 pLimitPrice,uint256 lLimitPrice) {
        SwapOrder storage orderInfo = allOrderHash[_orderID];
        require(orderInfo.userAddr == _userAddr, "closeSwap: USERADDR_WRONG");
        require(orderInfo.closePrice == 0, "closeSwap: ORDER_STATUS_WRONG");
        pLimitPrice = SwapTradeLibrary.calcSwapOrderPPrice(orderInfo.bsFlag,orderInfo.openPrice,_pLimitRate);
        lLimitPrice = SwapTradeLibrary.calcSwapOrderPPrice(orderInfo.bsFlag,orderInfo.openPrice,_lLimitRate);
        orderInfo.pLimitPrice = pLimitPrice;
        orderInfo.lLimitPrice = lLimitPrice;
    }    
    function getNewPrice(string memory _symbol) 
        public view 
        returns (uint256 newPrice,uint256 priceTime){
        (, newPrice,priceTime) = QuoteFactory(quoteFactoryAddr).getNewPrice(_symbol);
    }
    function getLastPrice(string memory _symbol,uint256 _blockIndex) 
        public view 
        returns (uint256 newPrice,uint256 priceTime){
        (, newPrice,priceTime) = QuoteFactory(quoteFactoryAddr).getLastPrice(_symbol,_blockIndex);
        require(newPrice > 0, "getLastPrice: LAST_PRICE_WRONG");
    }
}
